            split-idexs: (#s(si 71 86) #s(si 64 256))
            """
        let lines = input.split(separator: "\n").dropFirst()  // drop "ErrorList:" line
        var alts: [[Double]] = []
        var can_split: [Bool] = []
        var split_indexs: [SI] = []
        var errorOver = false
        var splitOver = false
        for line in lines {
            if line.contains("can-split:") {
                errorOver = true
            }
            if line.contains("split-idexs:") {
                splitOver = true
            }
            switch (errorOver, splitOver) {
            case (false, false):
                // Parse errors
                let errors = line.dropFirst().dropLast().split(separator: " ").map { Double($0)! }
                alts.append(errors)
            case (true, false):
                ()  // parse can split line
                can_split = line.replacingOccurrences(of: "can-split: (", with: "").dropLast().split(separator: " ").map
                { v in
                    if v == "#t" {
                        return true
                    } else {
                        return false
                    }
                }
            case (false, true):
                fatalError("Invalid data ordering")
            case (true, true):
                ()  // parse slit-idex
                let data = line.replacingOccurrences(of: "split-idexs: (", with: "").dropLast()
                let matches = data.matches(of: split_idx_regex)
                for match in matches {
                    let (_, cidx, pidx) = match.output
                    split_indexs.append(SI(Int(cidx)!, Int(pidx)!))
                }
            }
        }
        XCTAssertEqual(alts.first!.count, can_split.count)
        var original: [SplitIndex] = []
        var new: [SplitIndex] = []
        // measure {
        //     /*
        //     measured [Time, seconds] average: 0.170, relative standard deviation: 5.636%, values: [0.198359, 0.166215, 0.167706, 0.168491, 0.165696, 0.165992, 0.165914, 0.166080, 0.167752, 0.165701]
        //     */
        original = Original.regimes(err_list: alts, can_split)
        // }
