    sp-prev-out #(#(struct:cse 0 (#s(si 1 1))) #(struct:cse 18 (#s(si 2 2) #s(si 1 1))) #(struct:cse 65 (#s(si 2 3) #s(si 1 1))) #(struct:cse 131 (#s(si 0 4) #s(si 2 2) #s(si 1 1))))

    sp-prev #(#(struct:cse 0 (#s(si 1 1))) #(struct:cse 18 (#s(si 2 2) #s(si 1 1))) #(struct:cse 65 (#s(si 2 3) #s(si 1 1))) #(struct:cse 131 (#s(si 0 4) #s(si 2 2) #s(si 1 1))))
    sp-prev-out #(#(struct:cse 0 (#s(si 1 1))) #(struct:cse 18 (#s(si 2 2) #s(si 1 1))) #(struct:cse 65 (#s(si 2 3) #s(si 1 1))) #(struct:cse 131 (#s(si 0 4) #s(si 2 2) #s(si 1 1))))
    */
    func testAddSplitPoint() {
        let initial = [
            CSE(0, [SI(1, 1)]),
            CSE(33, [SI(2, 2)]),
            CSE(80, [SI(2, 3)]),
            CSE(196, [SI(0, 4)]),
        ]
        let psums = partial_sums(Basic.candidates)
        let num_points = Basic.candidates.first!.count
        let out1 = Original.addSplitPoint(num_points, initial, Double(num_points), psums, Basic.can_split)
        /*
        sp-prev-out #(
        #(struct:cse 0 (#s(si 1 1)))
        #(struct:cse 18 (#s(si 2 2) #s(si 1 1)))
        #(struct:cse 65 (#s(si 2 3) #s(si 1 1)))
        #(struct:cse 146 (#s(si 0 4) #s(si 2 2))))
        */
        let iteration_one = [
            CSE(0, [SI(1, 1)]),
            CSE(18, [SI(2, 2), SI(1, 1)]),
            CSE(65, [SI(2, 3), SI(1, 1)]),
            CSE(146, [SI(0, 4), SI(2, 2)]),
        ]
        XCTAssertEqual(out1, iteration_one)
        /*
        sp-prev-out #(
        #(struct:cse 0 (#s(si 1 1)))
        #(struct:cse 18 (#s(si 2 2) #s(si 1 1)))
        #(struct:cse 65 (#s(si 2 3) #s(si 1 1)))
        #(struct:cse 131 (#s(si 0 4) #s(si 2 2) #s(si 1 1))))
        */
        let out2 = Original.addSplitPoint(num_points, iteration_one, Double(num_points), psums, Basic.can_split)
        let interation_two = [
            CSE(0, [SI(1, 1)]),
            CSE(18, [SI(2, 2), SI(1, 1)]),
            CSE(65, [SI(2, 3), SI(1, 1)]),
            CSE(131, [SI(0, 4), SI(2, 2), SI(1, 1)]),
        ]
        XCTAssertEqual(out2, interation_two)
        /*
        sp-prev-out #(
        #(struct:cse 0 (#s(si 1 1)))
        #(struct:cse 18 (#s(si 2 2) #s(si 1 1)))
        #(struct:cse 65 (#s(si 2 3) #s(si 1 1)))
        #(struct:cse 131 (#s(si 0 4) #s(si 2 2) #s(si 1 1))))
        */
        let out3 = Original.addSplitPoint(num_points, interation_two, Double(num_points), psums, Basic.can_split)
        XCTAssertEqual(out3, interation_two)
    }
